Did you know that some water birds carry their young around on their backs? 

Until 2 weeks ago I didn’t but I really wanted to get a photo of it.

@whistlernaturalists tipped me off to Common Mergansers down at
Green Lake.

I found 2 families around the seaplane dock and one orphaned duckling who was chased off by both mothers and left solo in the reeds. (If anybody gets eyes on it, It needs to be caught and transferred to a rehab facility if it has been totally abandoned)

Here is a few of my photos of this not so common bird

